import Header from './components/header.js'
import './App.css';
import {
    BrowserRouter,
    Routes,
    Route,
} from 'react-router-dom';
import Contacts from './components/contacts.js';
import Calculation from './components/calculation.js';
import About from './components/about.js';

function App() {
    return (
        <div>
            <Header />
            <BrowserRouter>
                <Routes>
                    <Switch>
                        <Route path="/" component={Contacts} exact />
                        <Route path='/calculation' component={Calculation} />
                        <Route path='about' component={About} />
                    </Switch>
                </Routes>
            </BrowserRouter>
            <Switch>
                <Route path="/" component={Contacts} exact />
                <Route path='/calculation' component={Calculation} />
                <Route path='about' component={About} />
            </Switch>
            {/* <header className="App-header">
                <h1>DAARK</h1>
                <h2>The new company</h2>
                <h3>safdsadf</h3>
                <button className='primaryButtonText'>sadfasdf</button>
            </header> */}
        </div>
    );
}

export default App;
